import React from "react";
import getTweets from "../services/tweetService";

const Tweet = () => {
  const tweets = getTweets("reactjs");
  console.log(tweets);

  return (
    <blockquote className="twitter-tweet blockquote">
      <span className="author">John Smith </span>
      <span className="time"> 6 hours ago </span>
      <p lang="en" dir="ltr">
        <span>
          As Rockets try to move up to the four, five range in the West, they
          are one of two teams, along with Raptors, that will play the
          conference leading Lakers and Bucks. And they get both in the first
          four games, before teams might begin resting for the post-season.
        </span>
        {/* <a href="#"></a>
        <video poster="url" controls>
          <source src="url" type="url" />
        </video>
        <a href="url">
          <img className="img-thumbnail" src="" />
        </a> */}
      </p>
      <footer>
        <h5>
          <i className="fa fa-comment-o"></i> 20
          <i className="fa fa-retweet"></i> 25
          <i className="fa fa-heart-o"></i> 55
        </h5>
      </footer>
    </blockquote>
  );
};

export default Tweet;
